import { Label } from "@mui/icons-material";
import { LoadingButton } from "@mui/lab";
import { TableContainer, Paper, Table, TableHead, TableRow, TableCell, TableBody, Button, Typography, Box, Grid } from "@mui/material";
import { watchFile } from "fs";
import { Component, useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { NavLink } from "react-router-dom";
import Agent from "../../App/Api/Agent";
import AppDropzone from "../../App/Components/AppDropzone";
import AppSelectList from "../../App/Components/AppSelectList";
import AppTextInput from "../../App/Components/AppTextInput";
import LoadingComponent from "../../App/Layout/LoadingComponent";
import { Order } from "../../App/Models/Order";
import { useAppSelector } from "../../App/Store/ConfigureStore";


export default function MyProfile() {

    const [loading, setLoading] = useState(false);
    const { user } = useAppSelector(state => state.account)


    if (loading) return <LoadingComponent message="Loading Your Profile..." />
    return (
        <Box component={Paper} sx={{ p: 2, mt: 2 }}>
            <Typography variant="h4" gutterBottom sx={{ mb: 4 }}>
                User Details
            </Typography>
            <form>
                <Grid container spacing={3}>
                    <Grid item xs={12} sm={12}>
                        <Label col>{user?.email}</Label>
                    </Grid>
                    <Grid item xs={12} sm={12}>
                        <Label>{user?.roles}</Label>
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <Label>{user?.email}</Label>
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <Label>{user?.email}</Label>
                    </Grid>
                    </Grid>
            </form>
        </Box>
    )
}
